// src/pages/SuperAdmin/Schools.jsx
import { useEffect, useState } from "react";
import API from "../../services/api";

function Schools() {
  const [schools, setSchools] = useState([]);
  const [form, setForm] = useState({ name: "", address: "" });
  const [editId, setEditId] = useState(null);

  // Fetch all schools
  useEffect(() => {
    fetchSchools();
  }, []);

  const fetchSchools = async () => {
    try {
      const res = await API.get("/schools");
      setSchools(res.data);
    } catch (err) {
      console.error("Error fetching schools:", err);
    }
  };

  // Add / Update School
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editId) {
        await API.put(`/schools/${editId}`, form);
      } else {
        await API.post("/schools", form);
      }
      setForm({ name: "", address: "" });
      setEditId(null);
      fetchSchools();
    } catch (err) {
      console.error("Error saving school:", err);
    }
  };

  // Delete School
  const deleteSchool = async (id) => {
    if (!window.confirm("Are you sure you want to delete this school?")) return;
    try {
      await API.delete(`/schools/${id}`);
      fetchSchools();
    } catch (err) {
      console.error("Error deleting school:", err);
    }
  };

  // Fill form for editing
  const startEdit = (school) => {
    setEditId(school.id);
    setForm({ name: school.name, address: school.address });
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-6">Manage Schools</h1>

      {/* Add / Edit Form */}
      <form onSubmit={handleSubmit} className="mb-6 bg-white p-4 rounded shadow flex gap-3">
        <input
          type="text"
          placeholder="School Name"
          value={form.name}
          onChange={(e) => setForm({ ...form, name: e.target.value })}
          className="p-2 border rounded flex-1"
          required
        />
        <input
          type="text"
          placeholder="Address"
          value={form.address}
          onChange={(e) => setForm({ ...form, address: e.target.value })}
          className="p-2 border rounded flex-1"
          required
        />
        <button
          type="submit"
          className="bg-blue-500 text-white px-4 rounded"
        >
          {editId ? "Update" : "Add"}
        </button>
        {editId && (
          <button
            type="button"
            onClick={() => {
              setEditId(null);
              setForm({ name: "", address: "" });
            }}
            className="bg-gray-400 text-white px-4 rounded"
          >
            Cancel
          </button>
        )}
      </form>

      {/* Schools Table */}
      <div className="bg-white p-4 rounded shadow">
        <h2 className="text-xl font-semibold mb-3">All Schools</h2>
        <table className="w-full border">
          <thead>
            <tr className="bg-gray-200">
              <th className="p-2 border">ID</th>
              <th className="p-2 border">Name</th>
              <th className="p-2 border">Address</th>
              <th className="p-2 border">Actions</th>
            </tr>
          </thead>
          <tbody>
            {schools.map((s) => (
              <tr key={s.id}>
                <td className="p-2 border">{s.id}</td>
                <td className="p-2 border">{s.name}</td>
                <td className="p-2 border">{s.address}</td>
                <td className="p-2 border flex gap-2">
                  <button
                    onClick={() => startEdit(s)}
                    className="bg-yellow-500 text-white px-2 py-1 rounded"
                  >
                    Edit
                  </button>
                  <button
                    onClick={() => deleteSchool(s.id)}
                    className="bg-red-500 text-white px-2 py-1 rounded"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
            {schools.length === 0 && (
              <tr>
                <td colSpan="4" className="text-center p-3">
                  No schools found
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Schools;
